import React from 'react';
// import logo from './logo.svg';
import './MainContainer.css';


function tick() {
  const element = (
    <div>
      <h1>
        Hello World!
      </h1>
      <h2>
        It is {new Date().toLocaleTimeString()}.
      </h2>
    </div>
  )
  return element
}

setInterval(tick, 1000);


export default tick;
